import NavBar from "./Components/NavBar";
import { Switch, Route } from 'react-router-dom';
import Seminars from "./pages/Seminars";
import Users from "./pages/Users";
import Teams from "./pages/Teams";
import SeminarType from "./pages/SeminarType";
import SeminarDetails from "./pages/SeminarDetails";
import UserDetails from "./pages/UserDetails";
import './App.css'
import Footer from "./Components/Footer";
import Manager from "./pages/Manager";
import { useState } from "react";



function App() {

  const [isLogin , setIsLogin] = useState(false)

  // --------------------------- SESSIONS MANAGE -----------------------------------------

  function setToken() {
    sessionStorage.setItem('myData' , true);
    setIsLogin(true)
  }
  function getToken() {
    let data = sessionStorage.getItem('myData')
    console.log(data)

  }
  function deletToken() {
    sessionStorage.removeItem('myData');

  }

  //   -----------------------------------------

  return (

    <div>

    <div className='wraper'>

       <NavBar ></NavBar>
       <Footer/>

       <Switch>
         <Route exact path='/'>

           <Seminars />
         </Route>
         <Route exact path='/users'>
           <Users />
         </Route>
         <Route exact path='/teams'>
           <Teams />
         </Route>
         <Route exact path='/seminartype'>
           <SeminarType />
         </Route>
         <Route exact path='/seminar/:id'>
           <SeminarDetails />
         </Route>
         <Route exact path='/users/:id'>
           <UserDetails />
         </Route>
         <Route exact path='/users/manager/:id/:last_name'>
           <Manager/>
         </Route>
       </Switch>

       <button onClick={setToken}> Create Session </button>
       <button onClick={getToken}> Get Session </button>
       <button onClick={deletToken}> Delete Session </button>

    </div>

    </div>

  );
}

export default App;
